function performAction(condition, action) {
  if (condition) {
    action();
  }
}

// Function to disable right-click and prevent copying text
function disableRightClick() {
  document.addEventListener("contextmenu", (event) => event.preventDefault());
}

// Function to prevent specific key combinations (e.g., Ctrl + C, Ctrl + V)
function preventKeyCombinations(keyCodes) {
  document.addEventListener("keydown", (event) => {
    if (event.ctrlKey && keyCodes.includes(event.keyCode)) {
      event.preventDefault();
    }
  });
}

// Function to submit form when the enter key is pressed
function submitFormOnEnter() {
  $("input").keyup((event) => {
    if (event.keyCode === 13) {
      $("button").click();
    }
  });
}

